import { Col, Container, Row, Footer as f } from "react-bootstrap";

const Footer = () => {
  return ( 
    <f>
      <Container>
        <Row>
          <Col><image></image></Col>
          <Col>Discount Picker</Col>
          <Col>ex1</Col>
          <Col>ex2</Col>
        </Row>
      </Container>
    </f>
   );
}
 
export default Footer;
